import React from 'react'

function NotFound() {
    return (
        <div className="text-center" style={{padding:"200px"}}>
            <h1 style={{fontSize:"5rem"}}>Not found!</h1>
            <a href="/home" style={{fontSize:"1.5rem"}}>Link to home</a>
        </div>
    )
}

export default NotFound
